column2:
@KenticoKontent Thanks for the free ebook pdf. Very generous of y'all.
It will give me something to think about as i work from home in Indonesia while living in Malaysia. 
#Lockdown #COVID19 #WorldStayStrong

@atomaraullo PH is still in the 5th of covid cases in ASEAN countries after Malaysia, Thailand, Indonesia and Singapore.

Are you disgusted if we have less infections than those countries even they tested a lot. Remember, PH only country imposed #ECQ or #lockdown .

Your sowing fake news!!!

@AlisonPereiraPH PH is still in the 5th of covid cases in ASEAN countries after Malaysia, Thailand, Indonesia and Singapore.

Are you disgusted if we have less infections than those countries even they tested a lot. Remember, PH only country imposed #ECQ or #lockdown .

Your sowing fake news!!!

@theoriginallau1 Finding life at your own pace? 
I am currently in Malaysia,  we are in #Lockdown here and cannot move at all.  Roadblocks manned by Police and Armed Forces.  

The skies are blue again, the air cleaner &amp; little traffic noise.I see birds now that were inconsequential yesterday.

@KKMPutrajaya I want to bring humble attention to an office "symphony house", Ara Damansara. People are still working there and there is no social distance maintained. 
This is violation of #MCO  AND #lockdown #Malaysia.
Not to forget there is #COVID19 case reported in #Ara damansara area.
